import Image from "react-bootstrap/Image";

const Projects = () => {
  const link = "https://static1.squarespace.com/static/59decda418b27ddf3baeb5ba/t/59df05c6a8b2b02752fad4dc/1507788230333/Black.jpg?format=1500w";
  return (
    <div>
      <Image src={`${link}`} fluid/>
    </div>
  );
}

export default Projects;
